import React from 'react';
import PackageList from './packagesitem/PackageList';

function Packages() {
  return (
    <div className="bg-white min-h-screen p-3 flex flex-col">
      <h1 className="mb-4 p-2 bg-gradient-to-r from-violet-300 to-violet-400 text-black text-center font-bold rounded-lg"> Buy Packages</h1>
      
      <div className="flex-1 bg-blue-200 h-327px">
       {/* <PackageList/> */}
      </div>

      <div className="flex-1 mt-4 bg-red-300">
        {/* Content for the bottom section */}
      </div>
    </div>
  );
}

export default Packages;
